import React from 'react';
import { View, Text, ImageBackground, StyleSheet } from 'react-native';

const Banner = () => {
    return (
        <View>
            <Text>welcome To React Native</Text>

        </View>
    );
}

const styles = StyleSheet.create({
    bannerContainer: {
        padding: '10px',
    }
})

export default Banner;
